import axios from 'axios';
import AuthenticationService from './AuthenticationService';

const API_URL = "http://localhost:8080/api/openedStudents";

class OpenedStudentsService{
    
    getOpenedStudentsByUserId(userId){
        return axios.get(API_URL + "/byUser/" + userId, AuthenticationService.getConfig());
    }

    getOpenedStudentsByStudentId(studentId){
        return axios.get(API_URL + "/byStudent/" + studentId, AuthenticationService.getConfig());
    }

    saveOpenedStudent(openedStudent){
        return axios.post(API_URL, openedStudent, AuthenticationService.getConfig());
    }

    updateOpenedStudent(openedStudentId, newOpenedStudent){
        return axios.put(API_URL + "/" + openedStudentId, newOpenedStudent, AuthenticationService.getConfig());
    }

    deleteOpenedStudent(openedStudentId){
        return axios.delete(API_URL + "/" + openedStudentId, AuthenticationService.getConfig());
    }

}

export default new OpenedStudentsService();
